import React,{useState} from 'react'
import { View, Text,StatusBar,ScrollView,FlatList } from 'react-native'
import NavBar from "../components/NavBar"
import { Image } from 'react-native-elements';
import Card from "../components/Card"

const HomeScreen = () => {
   const data =[{"title":'shirt',"image":require("../assets/running1.jpg")},{"title":'shirt',"image":require("../assets/running1.jpg")},{"title":'shirt',"image":require("../assets/running1.jpg")},{"title":'shirt',"image":require("../assets/running1.jpg")},{"title":'shirt',"image":require("../assets/running1.jpg")},{"title":'shirt',"image":require("../assets/running1.jpg")}]
   const data2 =[{"title":'shirt',"image":require("../assets/running1.jpg")},{"title":'shirt',"image":require("../assets/running1.jpg")},{"title":'shirt',"image":require("../assets/running1.jpg")},{"title":'shirt',"image":require("../assets/running1.jpg")},{"title":'shirt',"image":require("../assets/running1.jpg")},{"title":'shirt',"image":require("../assets/running1.jpg")}]
    return (
        <View style={{ flex: 1}}>
          <StatusBar barStyle="light"/>
          <NavBar/>
          <Image
            source={{ uri: require("../assets/running1.jpg")}}
            style={{height: 250 }}
            />
          <Text>Women</Text>
        <FlatList
        data={data}
        horizontal={true}
        noOfColumns={1}
        keyExtractor={(item) => item.id}
        renderItem={({ item }) => 
        <View>
            <Card title={item.title} image={item.image} price={item.price}/>
            
        </View>}
     />
     <Text>Men</Text>
        <FlatList
        data={data2}
        horizontal={true}
        noOfColumns={1}
        keyExtractor={(item) => item.id}
        renderItem={({ item }) => 
        <View>
            <Card title={item.title} image={item.image} price={item.price}/>
            
        </View>}
     />
        </View>
      );
    }

export default HomeScreen
